import React, { useReducer } from 'react';
import {
  ADD_CONTACT,
  DELETE_CONTACT,
  SET_CURRENT,
  CLEAR_CURRENT,
  UPDATE_CONTACT,
  FILTER_CONTACT,
  CLEAR_CONTACT,
} from '../types';
import { contactContext } from './contactContext';
import { contactReducers } from './contactReducers';
import uui from 'uuid';
export const ContactState = (props) => {
  const initailState = {
    contacts: [
      {
        id: 1,
        name: 'ibrahim',
        email: 'ibrahim@gmail.com',
        phone: '0093838',
        type: 'Personal',
      },
      {
        id: 2,
        name: 'ismail',
        email: 'ismailm@gmail.com',
        phone: '930308',
        type: 'Personal',
      },
      {
        id: 3,
        name: 'ishaq',
        email: 'ishqm@gmail.com',
        phone: '037388',
        type: 'Personal',
      },
    ],
  };

  const [state, dispatch] = useReducer(contactReducers, initailState);
  return (
    <contactContext.Provider value={{ contacts: state.contacts }}>
      <props.children />
    </contactContext.Provider>
  );
};
